import React, { useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import "./Login.css";
export default function Login(){

    const history=useNavigate();

    const [email,setEmail]=useState(' ')
    const [password,setPassword]=useState(' ')

    async function submit(e){
        e.preventDefault();

        try{
            await axios.post("http://localhost:3000/login",{
                email,password
            }).then(res=>{
                if(res.data==="exist"){
                    history("/about")  //to go to after login
                }
                else if(res.data==="notexit"){
                    alert("User have not signup")
                }
            })
            .catch(e=>{
                alert("wrong details");
                console.log(e);
            })
        }
        catch(e){
            console.log(e);
        }
    }
    return(
    <>
    <h1>Login</h1>
    <form action="POST">
  <div class="row mb-3">
    <label for="inputEmail3" class="col-sm-2 col-form-label">Email</label>
    <div class="col-sm-10">
      <input type="email" onChange={(e)=>{setEmail(e.target.value)}} class="form-control" id="inputEmail3" placeholder="email"/>
    </div>
  </div>
  <div class="row mb-3">
    <label for="inputPassword3" class="col-sm-2 col-form-label">Password</label>
    <div class="col-sm-10">
      <input type="password" class="form-control" onChange={(e)=>{setPassword(e.target.value)}} placeholder="password" id="inputPassword3"/>
    </div>
  </div>
  <input type="submit" class="btn btn-primary" onClick={submit}>Login</input>
</form>
    </>
        // <div className={`login text-align-center justify-content-center`}>
